import Lo from "./Login.module.css";
import { Link } from "react-router-dom";

export default function Login() {
  return (
    <div className={Lo.mn}>
        <div className={Lo.cont}>
            <lable>Username : </lable>
            <input type='name' placeholder='Enter U'></input>
            <label>Password : </label>
            <input></input>
            <Link></Link>
        </div>
    </div>
  )
}
